import React from 'react';
import './Unit.css';

function Unit({ unit, subUnitList }){
    const unitNames = ['Introduction to Data Science and Supervised Learning', 'Unsupervised and Other Types of Learning', 'State-of-the-art Architectures', 'Applications']
    const overview = ['Data science is a field that uses statistics, mathematics, and computer science to extract knowledge from large amounts of data. Since the amount of digital information has grown exponentially in the past few years, ']
    return (
        <div className="unit">
            <h2>Unit {unit} - {unitNames[unit-1]}</h2>
            <ul>{subUnitList}</ul>
        </div>
    );
};
export default Unit;
